import AllGames from "./AllGames";
import FavoriteGames from "./FavoriteGames"

function Games() {

  return (
    <section id="games" className="transition-all duration-300 ease-in-out">
      <div className="transition-all duration-300 ease-in-out">
        <FavoriteGames />
      </div>
      <div className="transition-all duration-300 ease-in-out">
        <h2 className="text-2xl font-bold text-white text-left mb-3 mx-auto max-w-4xl px-2 sm:px-3">All Games</h2>
        <AllGames />
      </div>
    </section>
  );

}

export default Games;
